function FilterModex({ filterImage, selectedImage }: any): JSX.Element {
  const postFilterItemsRef = useRef<any>([]);
  ///
  ///
  ///
  ///CREATE REFS FROM POSTS AND ADD THEM TO ARRAY
  const addfilterbaseimageRef = (itemsRef: any) => {
    if (itemsRef && !postFilterItemsRef.current.includes(itemsRef)) {
      postFilterItemsRef.current.push(itemsRef);
    }
    ////console.log(postItemsRef.current[1]);
  };

  return (
    <>
      {selectedImage.map((index: any) => {
        console.log(index);
        return (
          <ImageTobeFiltered
            selectedImage={selectedImage}
            key={index}
            filterbaseimageRef={postFilterItemsRef}
            filterImage={data}
            index={index}
            addfilterbaseimageRef={addfilterbaseimageRef}
          />
        );
      })}
    </>
  );
}

export const FilterMode = React.memo(FilterModex);
